import React, { useContext, useState } from "react";
import axios from "axios";
import Header from "../pages/Header";
import Footer from "../pages/Footer";
import Main from "../pages/Main";

function App() {

  return (
    <div className="App">
      <Header />
      <Routes>
      <Route path="/main" element={<Main />} />
      </Routes>
      <Footer />
    </div>
  );
}

export default App;
